import React from 'react';
import {Link} from "react-router-dom";



function CardItem({ src, text, link, label }) {
    const isExternalLink = link.startsWith('http://') || link.startsWith('https://');
    return (
        <div className='cards__item'>
            {/* Use the appropriate element based on whether it's an external or internal link */}
            {isExternalLink ? (
            <a href={link} target='_blank' rel='noopener noreferrer' className='cards__item__link'>
                <figure className='cards__item__pic-wrap' data-category={label}>
                    {/* Use the appropriate element based on the content (video or image) */}
                    {src.endsWith('.mp4') ? (
                        <video
                            className='cards__item__img'
                            alt='Travel Video'
                            autoPlay
                            loop
                            muted
                        >
                            <source src={src} type='video/mp4' />
                            Your browser does not support the video tag.
                        </video>
                    ) : (
                        <img
                            className='cards__item__img'
                            alt='Travel Image'
                            src={src}
                        />
                    )}
                </figure>

                <div className='cards__item__info'>
                    <h5 className='cards__item__text'>{text}</h5>
                </div>
            </a>
            ) : (
                <Link to={link} className='cards__item__link'>
                    {/* ... */}
                </Link>
            )}
        </div>
    );
}



export default CardItem;
